    fun decompressGzippp(data: String): ByteArray {
        val decodedBytes = String(Base64.decode(data, Base64.DEFAULT))

        val inputStream = ByteArrayInputStream(decodedBytes.toByteArray())
        Log.d("TAGheue", inputStream.toString())
        val outputStream = ByteArrayOutputStream()
        val buffer = ByteArray(1024)
        var length: Int
        val gzipInputStream = GZIPInputStream(inputStream)
        while (gzipInputStream.read(buffer).also { length = it } > 0) {
            outputStream.write(buffer, 0, length)
        }
        gzipInputStream.close()
        outputStream.close()
        Log.d("TAGheu", outputStream.toString())
        return outputStream.toByteArray()
    }


    fun callOpenBoxAPI(apiKey: String, boxId: Int, tokenFormat: Int) {
        val url = "https://api-d4me-stage.direct4.me/sandbox/v1/Access/openbox"
        val requestQueue: RequestQueue = Volley.newRequestQueue(this)
        val jsonObject = JSONObject()
        jsonObject.put("boxId", boxId)
        jsonObject.put("tokenFormat", tokenFormat)
        val jsonObjectRequest = object : JsonObjectRequest(Method.POST, url, jsonObject,
            Response.Listener { response ->
                val data = response.optString("data")
                Log.d("api", "zeton $data")
                sickaf(data)
                //predvajajWavIzBase64(data)
            },
            Response.ErrorListener { error ->
                Log.e("errrrrrr", Log.getStackTraceString(error))
            }) {
            override fun getHeaders(): MutableMap<String, String> {
                val headers = HashMap<String, String>()
                headers["Authorization"] = "Bearer $apiKey"
                headers["Content-Type"] = "application/json"
                return headers
            }
        }
        jsonObjectRequest.retryPolicy = DefaultRetryPolicy(
            15000, // 10 sekund (v milisekundah)
            DefaultRetryPolicy.DEFAULT_MAX_RETRIES,
            DefaultRetryPolicy.DEFAULT_BACKOFF_MULT
        )
        requestQueue.add(jsonObjectRequest)
    }
    fun epsko(encoded: String) {
        val decoded = String(Base64.decode(encoded, Base64.DEFAULT))
        Log.d("TAGHEUR", decoded)
        val compressedData: ByteArray? = decoded.toByteArray()
        //Log.d("TAGheur2", ": $decoded")
        val decompressor = Inflater()
        decompressor.setInput(compressedData)
        val bos = ByteArrayOutputStream(compressedData!!.size)
        val buf = ByteArray(1024)
        while (!decompressor.finished()) {
            try {
                val count = decompressor.inflate(buf)
                bos.write(buf, 0, count)
            } catch (e: Exception) {
                Log.e("TAGheur", "Napaka pri dekompresiji: ${e.message}")
                e.printStackTrace()
            }
        }
        bos.close()
        val decompressedData = bos.toByteArray()
        Log.d("TAGheur3", "decompressed: $decompressedData")

    }
    fun sickaf(getapi: String) {
        //val getapi = ""
        //val getapi = ""
        val decodedBytes = Base64.decode(getapi, Base64.DEFAULT)
        val tempFile = File.createTempFile("temp", null, cacheDir)
        val fos = FileOutputStream(tempFile)
        fos.write(decodedBytes)
        val zipFile = ZipFile(tempFile)
        val entries = zipFile.entries()

        while (entries.hasMoreElements()) {
            val entry = entries.nextElement()
            val entryName = entry.name
            val entryInputStream = zipFile.getInputStream(entry)

            // Ustvarite začasno datoteko iz InputStream
            val tempEntryFile = File.createTempFile("temp", null, cacheDir)
            val foss = FileOutputStream(tempEntryFile)
            entryInputStream.copyTo(foss)
            fos.close()

            val mediaPlayer = MediaPlayer()
            mediaPlayer.setDataSource(tempEntryFile.absolutePath)
            mediaPlayer.prepare()
            mediaPlayer.start()

            entryInputStream.close()
        }

        zipFile.close()
    }
